        color:'red'
    }
});


export class SignIn extends Component {         
    render() {
        return(
            <div>
                 <form className="loginform" noValidate autoComplete="off">
                    <h4>Email</h4>
                    <TextField id="outlined-basic" label="Email" variant="outlined" className="textfieldlogin" color="secondary"/>
                    <h4>Password</h4>
                    <TextField id="outlined-basic" label="Email" variant="outlined" className="textfieldlogin" color="secondary"/>
                </form>
            </div>
        )
    }
}

export default SignIn;
